import Nav from 'react-bootstrap/Nav';

function Navigation() {
  return (
    <Nav variant="tabs" defaultActiveKey="/">
      <Nav.Item>
        <Nav.Link >Active</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link>Option 2</Nav.Link>
      </Nav.Item>
    </Nav>
  );
}

export default Navigation;
